import styled from "styled-components";


export const TelaInteira=styled.div`
  height: 100vh;
  display: flex;
  flex-direction: column;
`

export const Cabecalho=styled.header`
  background-color: orange;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 50px;
  height: 10%;

`
